import './App.css';

import NavBar from './components/NavBar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';


function App() {
  return (
    <>
      <Router>
        <NavBar />
      </Router>

    <div className="pages">
      <Switch>
         {/* component={signup} */}
         <Route exact path="/signup" />
         {/* component={login} */}
         <Route exact path="/login" />
        {/* component={homepage} */}
        <Route exact path="/" />
      </Switch>
    </div>
    </>
  );
}

export default App;
